window.bookSummaryJSON = "<p><b>The gods are dying. But for one man, death is only the beginning.&nbsp;</b></p> <p>Murdered as a ritual sacrifice, amateur thief and professional charmer Dustin Graves mysteriously survives, finding himself gifted with strange, dark magic. Then more dead bodies turn up. Some are human, but one is a god of the old world, slain at his own doorstep.&nbsp;</p> <p>Mortal or divine, the bloodshed must end, and Dust is the mage for the job. But first he must contend with a succubus, a talking sword, a spider queen, a goddess of magic, and eldritch abominations from beyond the stars. No big deal...right?&nbsp;</p> <p>If you like snarky heroes, snappy dialogue, and a bit of grit and gore, you'll love the first standalone audiobook in Nazri Noor's series of urban fantasy novels. Explore the Darkling Mage universe and discover a taste of <i>Shadow Magic</i> today.</p>"; 
